import React, { Component } from 'react';

class Header extends Component {
  render() {
    return(
      <div>
        <nav>
          <ul>
           <li><a href="">Planes</a></li>
           <li><a href="">Flights</a></li>
           <li><a href="">Admin</a></li>
          </ul>
      </nav>
      </div>
    )
  }
}
export default Header;
